import React, { ReactElement } from "react";
import styled from "styled-components/native";
import FM from "./FM/index";

interface Props {}

export default function Root({}: Props): ReactElement {
  return (
    <Styled.container>
      <FM />
    </Styled.container>
  );
}

const Styled = {
  container: styled.View`
    flex: 1;
  `,
  heading: styled.Text``,
};
